import React, { Component } from 'react'
import styled from 'styled-components'

// Components
import FullScreen from '../fullscreen'
import Title from '../title'

// Images
import background from './background.jpg'

const ProfileWrapper = styled(FullScreen)`
  background: linear-gradient(rgba(0, 0, 0, 0.7), rgba(0, 0, 0, 0.7)),
    url(${background});
  background-size: cover;
  color: white;
  width: 70%;
  display: inline-block;
  vertical-align: top;
`

const ProfileContainer = styled.div`
  width: intrinsic;
  padding: 30px 50px;
  position: relative;
`
const ProfileBorder = styled.div`
  &:before {
    content: '';
    position: absolute;
    width: 70%;
    height: 60%;
    bottom: 0;
    left: 0;
    border-bottom: 1px solid rgba(255, 255, 255, 0.6);
    border-left: 1px solid rgba(255, 255, 255, 0.6);
  }

  &:after {
    content: '';
    position: absolute;
    width: 70%;
    height: 60%;
    top: 0;
    right: 0;
    border-top: 1px solid rgba(255, 255, 255, 0.6);
    border-right: 1px solid rgba(255, 255, 255, 0.6);
  }
`

const ProfileTitle = styled(Title)`
  font-family: 'Julius Sans One', sans-serif;
  font-size: 3.5rem;
  text-align: left;
`

const ProfileDetail = styled.p`
  font-size: 0.9rem;
  letter-spacing: 3px;
  margin: 0;
  opacity: 0.6;
  margin-left: 5px;
`

const ExperinceWrapper = styled(FullScreen)`
  width: 30%;
  padding: 50px;
  display: inline-block;
  vertical-align: top;
`

const ExperinceContainer = styled.div`
  margin: 0 0 20px;
`

const ExperinceTitle = styled.p`
  margin: 0;
`

const ExperinceTime = styled.p`
  color: #a7c7f9;
  font-size: 0.8rem;
  margin: 0;
`

const ExperinceDetail = styled.p`
  color: #afb5bf;
  font-size: 0.8rem;
  margin: 0;
`

class Profile extends Component {
  render() {
    return (
      <React.Fragment>
        <ProfileWrapper>
          <ProfileContainer>
            <ProfileBorder />
            <ProfileTitle>Punn</ProfileTitle>
            <ProfileDetail>Punchaya Siriphanthong</ProfileDetail>
            <ProfileDetail>26 December 1996 | 22 years old</ProfileDetail>
            <ProfileDetail>p.siriphanthong@gmail.com</ProfileDetail>
          </ProfileContainer>
        </ProfileWrapper>
        <ExperinceWrapper>
          <Title>Education</Title>
          <ExperinceContainer>
            <ExperinceTitle>
              King Mongkut's University of Technology Thonburi
              <ExperinceTime>2015 - Now</ExperinceTime>
            </ExperinceTitle>
            <ExperinceDetail>
              Bachelor's Degree: Faculty of Engineering, Department of Computer
              Engineering
            </ExperinceDetail>
          </ExperinceContainer>
          <ExperinceContainer>
            <ExperinceTitle>Assumption College Ubonratchathani</ExperinceTitle>
            <ExperinceTime>2000 - 2014</ExperinceTime>
            <ExperinceDetail>Majoring: Mathematics and Science</ExperinceDetail>
          </ExperinceContainer>
          <Title>Working</Title>
          <ExperinceContainer>
            <ExperinceTitle>Askforanywork</ExperinceTitle>
            <ExperinceTime>June 2017 - Now</ExperinceTime>
            <ExperinceDetail>
              Part-Time: Full-Stack Web Development
            </ExperinceDetail>
          </ExperinceContainer>
          <ExperinceContainer>
            <ExperinceTitle>
              Institute of High Performance Computing in Singapore
            </ExperinceTitle>
            <ExperinceTime>May 2018 - Aug 2018</ExperinceTime>
            <ExperinceDetail>
              Internship: Big Data Analytics and Machine Learning
            </ExperinceDetail>
          </ExperinceContainer>
          <ExperinceContainer>
            <ExperinceTitle>Artificial Anything</ExperinceTitle>
            <ExperinceTime>Jul 2017</ExperinceTime>
            <ExperinceDetail>
              Internship: Embedded System Implementation
            </ExperinceDetail>
          </ExperinceContainer>
        </ExperinceWrapper>
      </React.Fragment>
    )
  }
}

export default Profile
